const Header = (props) => {
    return (
          
     <nav>
        <div className="logo">
            <link to = "/">MiLogo</link>
        </div>
        <div className="nav-links">
            <link to= "/contacto">Contacto</link>
            <link to= "/sobre-mi">Sobre Mi</link>
            <link to= "/tienda">Tienda</link>
            <link to= "/carrito">Carrito</link>
        </div>
    </nav>             

    )
}
export default Header;
